'use strict';const {PrismaClient}=require("./app/generated/prisma"),bcrypt=require("bcryptjs"),prisma=new PrismaClient;
async function createTestUser(){try{const a=await prisma.user.findUnique({where:{email:"test@test.com"}});if(a)console.log("User already exists:",a.email);else{var c=await bcrypt.hash("TestPass123!",12),b=await prisma.user.create({data:{email:"test@test.com",name:"Test User",password:c,emailVerified:!0,emailVerifiedAt:new Date}});console.log("Test user created successfully:",{id:b.id,email:b.email,emailVerified:b.emailVerified})}}catch(a){console.error("Error creating test user:",a)}finally{await prisma.$disconnect()}}
createTestUser();